INSERT INTO `rrcms_block` (`block_id`, `title`, `identifier`, `content`, `creation_time`, `update_time`, `is_active`) VALUES
(1, 'Footer Links', 'footer_links', '\n<ul>\n    <li><a href="{{store direct_url="about-magento-demo-store"}}">About Us</a></li>\n    <li><a href="{{store direct_url="customer-service"}}">Customer Service</a></li>\n<li class="last privacy"><a href="{{store direct_url="privacy-policy-cookie-restriction-mode"}}">Privacy Policy</a></li>\r\n</ul>', '2015-12-08 14:05:51', '2015-12-08 14:05:54', 1),
(2, 'Footer Links Company', 'footer_links_company', '\n<div class="links">\n    <div class="block-title">\n        <strong><span>Company</span></strong>\n    </div>\n    <ul>\n        <li><a href="{{store url=""}}about-magento-demo-store/">About Us</a></li>\n        <li><a href="{{store url=""}}contacts/">Contact Us</a></li>\n        <li><a href="{{store url=""}}customer-service/">Customer Service</a></li>\n        <li><a href="{{store url=""}}privacy-policy-cookie-restriction-mode/">Privacy Policy</a></li>\n    </ul>\n</div>', '2015-12-08 14:05:53', '2015-12-08 14:05:53', 1),
(3, 'Cookie restriction notice', 'cookie_restriction_notice_block', '<p>This website requires cookies to provide all of its features. For more information on what data is contained in the cookies, please see our <a href="{{store direct_url="privacy-policy-cookie-restriction-mode"}}">Privacy Policy page</a>. To accept cookies from this site, please click the Allow button below.</p>', '2015-12-08 14:05:55', '2015-12-08 14:05:55', 1),
(4, 'WeltPixel Mobile Block', 'weltpixel_mm_custom_mobile_block', '<p>Lorem ipsum dolor sit amet</p>', '2015-12-08 15:00:10', '2015-12-08 15:00:20', 1),
(5, 'WelPixel Newsletter', 'weltpixel_newsletter', '\n<!-- LEFT CONTENT SECTION BEGIN -->\n<div class="col-md-7 weltpixel_newsletter_signup_section">\n<div class="title">JOIN OUR MAILING LIST</div>\n<div class="title-detail"></div>\n\n<p>Pellentesque de fermentum mollis comodous an loremous</p>\n\n<!-- NEWSLETTER LOGIN BLOCK BEGIN -->\n{{block type="core/template" name="weltpixel_newsletter_popup" template="weltpixel/newsletter/popup.phtml"}}\n<!-- NEWSLETTER LOGIN BLOCK END -->\n\n<p><strong>SIGN UP FOR EXCLUSIVE UPDATES, NEW ARRIVALS AND INSIDER-ONLY DISCOUNTS</strong></p>\n<!-- SOCIAL ICONS BEGIN -->\n<div>\n<a href="#" class="social-icons si-dark si-rounded si-facebook">\n    <i class="icon-facebook"></i>\n    <i class="icon-facebook"></i>\n</a>\n\n<a href="#" class="social-icons si-dark si-rounded si-twitter">\n    <i class="icon-twitter"></i>\n    <i class="icon-twitter"></i>\n</a>\n\n<a href="#" class="social-icons si-dark si-rounded si-google">\n    <i class="icon-google"></i>\n    <i class="icon-google"></i>\n</a>\n\n<a href="#" class="social-icons si-dark si-rounded si-instagram">\n    <i class="icon-instagram"></i>\n    <i class="icon-instagram"></i>\n</a>\n\n<a href="#" class="social-icons si-dark si-rounded si-vimeo">\n    <i class="icon-vimeo"></i>\n    <i class="icon-vimeo"></i>\n</a>\n\n<a href="#" class="social-icons si-dark si-rounded si-pinterest">\n    <i class="icon-pinterest"></i>\n    <i class="icon-pinterest"></i>\n</a>\n</div>\n<!-- SOCIAL ICONS END -->\n</div>\n<!-- LEFT CONTENT SECTION END -->\n<!-- IMAGE SECTION BEGIN -->\n<div class="col-md-5 col-last" style="padding:0px;">\n<img class="image-fade" alt="Newsletter Fashion Box" src="{{skin url=''media/cleo/v1/34396788_012_h.jpg''}}" style="width:100%">\n</div>\n<!-- IMAGE SECTION END -->', '2015-12-08 15:00:12', '2015-12-08 15:00:21', 1),
(6, 'Weltpixel Empty Cart Page Static Block', 'weltpixel_empty_cart', '<p>This block can be edited from the static static block with the following identifier: cleo_empty_cart</p>', '2015-12-08 15:00:16', '2015-12-08 15:00:22', 1),
(7, 'Footer Newsletter Static Block', 'weltpixel_footer_newsletter', '<p>By subscribing to our mailing list you will<br />always be update with the latest news.</p>', '2015-12-08 15:00:17', '2015-12-08 15:00:22', 1),
(8, 'Weltpixel Section 2 version 2', 'weltpixel_footer_section2-2', '<!-- FOOTER COLUMN #1 BEGIN -->\r\n<div class="col-md-3 col-sm-6 col-xs-12 mobile-toggle">\r\n<h4>RENTRAM</h4>\r\n<p><i class="icon icon-location"></i>9087S Divamus Faucibus Str., <br/>\r\nJaipur, 302019, <br>\r\nRaj, India. <br><br>\r\n<i class="icon  icon-phone3"></i> (1800) 000 000<br/>\r\n<i class="icon  icon-line-mail"></i> contact@rentram.com</p><br/>\r\n</div>\r\n<!-- FOOTER COLUMN #1 END -->\r\n\r\n<!-- FOOTER COLUMN #2 BEGIN -->\r\n<div class="col-md-3 col-sm-6 col-xs-12 mobile-toggle">\r\n<h4>Company</h4>\r\n<ul>\r\n	<li><a href="{{store url=''about-magento-demo-store''}}">About Us</a></li>\r\n	<li><a href="{{store url=''contacts''}}">Contact Us</a></li>\r\n	<li><a href="{{store url=''customer-service''}}">Customer Service</a></li>\r\n	<li><a href="{{store url=''policy''}}">Rentram Policies</a></li>\r\n        <li><a href="{{store url=''rentram-faq''}}">F.A.Q.</a></li>\r\n</ul>\r\n</div>\r\n<!-- FOOTER COLUMN #2 END -->\r\n\r\n<div class="col-sm-clear"></div>\r\n<div class="clearfix visible-sm-block"></div>\r\n\r\n<!-- FOOTER COLUMN #3 BEGIN -->\r\n<div class="col-md-3 col-sm-6 col-xs-12 mobile-toggle">\r\n<h4>Quick Links</h4>\r\n<ul>\r\n	<li><a href="{{store url=''catalog/seo_sitemap/category''}}" title="Site Map">Site Map</a></li>\r\n	<li><a href="{{store url=''catalogsearch/term/popular''}}" title="Search Terms">Search Terms</a></li>\r\n	<li><a href="{{store url=''catalogsearch/advanced''}}" title="Advanced Search">Advanced Search</a></li>\r\n        <li><a href="{{store url=''marketplace/vendor/register''}}" title="Rent products">Rent with us</a></li>\r\n        <li><a href="{{store url=''backend''}}" title="Seller listing account">Seller Account</a></li>\r\n</ul>\r\n</div>\r\n<!-- FOOTER COLUMN #3 END -->\r\n\r\n<!-- FOOTER COLUMN #4 BEGIN -->\r\n<div class="col-md-3 col-sm-6 col-xs-12 mobile-toggle">\r\n<h4>Let''s Stay in touch!</h4>\r\n<div>\r\n<!-- FOOTER SOCIAL-ICONS BEGIN -->\r\