(18, 'Weltpixel Contact Page', 'weltpixel_contact_page', '<h4> Contact Information </h4>\n<p>\nIf you would like to talk to us about a project or you have a question, please get in touch. Fill in our contact form below and we’ll get right back to you.<br>\n\nWhether you’re looking to discuss a new project or simply say hello, we’d love to hear from you.</p>\n\n<h4><i class="icon icon-location"></i> Address: </h4>\n<p>8500 Beverly Boulevard Los Angeles, CA 90048</p>\n\n<h4><i class="icon  icon-phone3"></i> Phone: </h4>\n<p>1 800 000 000</p>\n\n<h4><i class="icon  icon-line-mail"></i> Email: </h4>\n<p>mail@email.com</p>', '2015-12-08 15:00:32', '2015-12-08 15:00:32', 1),
(19, 'Weltpixel Smart Block', 'weltpixel_smart_block', '\n<!-- CSS BLOCK BEGIN -->\n<style scoped>\n/*===================================================================================*/\n/* table size chart                                                                             */\n/*===================================================================================*/\n\n	.sizeChart th:first-child{-webkit-border-radius: 6px 0 0 0;border-radius: 6px 0 0 0;border-left: 0;}\n	.sizeChart{border: 6px solid #E6E6E6 !important;-webkit-border-radius: 6px;border-radius: 6px;background-color: #eeeeee;width: 100% !important;font-size: 12px;margin-top: 20px;}\n	.sizeChart.partialWidth{width: 250px !important;}\n	.sizeChart.twoSideBySide{float: left;margin-bottom: 1em;margin-right: 20px;width: 220px !important;}\n	.sizeChart.threeSideBySide{float: left;margin-bottom: 1em;margin-right: 0;width: 100% !important;}\n	.sizeChart .cm{display: none;}\n	.sizeChart td{border-left: 1px solid #e6e6e6;border-top: 1px solid #e6e6e6;padding: 6px;text-align: center;vertical-align: middle;}\n	.sizeChart tr.odd td{background-color: #f8f8f8;}\n	.sizeChart th{background-color: #e6e6e6;border: 0;padding: 4px 10px 7px 10px;text-align: center;font-size: 9px;font-weight: bold;color: #666666;}\n	.sizeChartTitle{display: none;}\n\n</style>\n<!-- CSS BLOCK END -->\nThe <b>Smart Box</b> area can be customized based on product attribute.<br> Best example is the sizing chart or shipping/return policy...\n<!-- PROMO BLOCK HEADER BEGIN -->\n									<div class="col-12">\n										<div class="promo-box">\n										<i class="promo-box-icon icon-resize-full"></i>\n										<h4>Womens  Smart Box</h4>\n										<h5>Size Chart</h5>\n										</div>\n									</div>\n<!-- PROMO BLOCK HEADER END -->\n\n<!-- SIZE TABLE BLOCK BEGIN -->\n									<div class="col-12">\n										<table class="sizeChart sizesUS" style="display: table;">\n											<tbody>\n											<tr>\n											<th style="WIDTH: 60px">SIZE</th>\n											<th>CHEST (in)</th>\n											<th>WAIST (in)</th>\n											<th>HIP (in)</th>\n											</tr>\n											<tr class="odd">\n											<td>S</td>\n											<td>35 - 37 1/2</td>\n											<td>29 - 32</td>\n											<td>35 - 37 1/2</td>\n											</tr>\n											<tr>\n											<td>M</td>\n											<td>37 1/2 - 41</td>\n											<td>32 - 35</td>\n											<td>37 1/2 - 41</td>\n											</tr>\n											<tr class="odd">\n											<td>L</td>\n											<td>41 - 44</td>\n											<td>35 - 38</td>\n											<td>41 - 44</td>\n											</tr>\n											<tr>\n											<td>XL</td>\n											<td>44 - 48 1/2</td>\n											<td>38 - 43</td>\n											<td>44 - 47</td>\n											</tr>\n											<tr class="odd">\n											<td>XXL</td>\n											<td>48 1/2 - 53 1/2</td>\n											<td>43 - 47 1/2</td>\n											<td>47 - 50 1/2</td>\n											</tr>\n											<tr>\n											<td>XXXL</td>\n											<td>53 1/2 - 58</td>\n											<td>47 1/2 - 53 1/2</td>\n											<td>50 1/2 - 53 1/2</td>\n											</tr>\n											<tr class="odd">\n											<td>XXXXL</td>\n											<td>58 - 63</td>\n											<td>52 1/2 - 57</td>\n											<td>53 1/2 - 57</td>\n											</tr>\n											</tbody>\n										</table>\n									</div>\n<!-- SIZE TABLE BLOCK END -->\n', '2015-12-08 15:00:33', '2015-12-08 15:00:33', 1),
