(21, 'Female smart block', 'female_smart_block', '\n<!-- CSS BLOCK BEGIN -->\n<style scoped>\n/*===================================================================================*/\n/* table size chart                                                                             */\n/*===================================================================================*/\n\n	.sizeChart th:first-child{-webkit-border-radius: 6px 0 0 0;border-radius: 6px 0 0 0;border-left: 0;}\n	.sizeChart{border: 6px solid #E6E6E6 !important;-webkit-border-radius: 6px;border-radius: 6px;background-color: #eeeeee;width: 100% !important;font-size: 12px;margin-top: 20px;}\n	.sizeChart.partialWidth{width: 250px !important;}\n	.sizeChart.twoSideBySide{float: left;margin-bottom: 1em;margin-right: 20px;width: 220px !important;}\n	.sizeChart.threeSideBySide{float: left;margin-bottom: 1em;margin-right: 0;width: 100% !important;}\n	.sizeChart .cm{display: none;}\n	.sizeChart td{border-left: 1px solid #e6e6e6;border-top: 1px solid #e6e6e6;padding: 6px;text-align: center;vertical-align: middle;}\n	.sizeChart tr.odd td{background-color: #f8f8f8;}\n	.sizeChart th{background-color: #e6e6e6;border: 0;padding: 4px 10px 7px 10px;text-align: center;font-size: 9px;font-weight: bold;color: #666666;}\n	.sizeChartTitle{display: none;}\n\n</style>\n<!-- CSS BLOCK END -->\n\n<!-- PROMO BLOCK HEADER BEGIN -->\n									<div class="col-12">\n										<div class="promo-box">\n										<i class="promo-box-icon icon-resize-full"></i>\n										<h4>Womens  Smart Box</h4>\n										<h5>Size Chart</h5>\n										</div>\n									</div>\n<!-- PROMO BLOCK HEADER END -->\n\n<!-- SIZE TABLE BLOCK BEGIN -->\n									<div class="col-12">\n										<table class="sizeChart sizesUS" style="display: table;">\n											<tbody>\n											<tr>\n											<th style="WIDTH: 60px">SIZE</th>\n											<th>CHEST (in)</th>\n											<th>WAIST (in)</th>\n											<th>HIP (in)</th>\n											</tr>\n											<tr class="odd">\n											<td>S</td>\n											<td>35 - 37 1/2</td>\n											<td>29 - 32</td>\n											<td>35 - 37 1/2</td>\n											</tr>\n											<tr>\n											<td>M</td>\n											<td>37 1/2 - 41</td>\n											<td>32 - 35</td>\n											<td>37 1/2 - 41</td>\n											</tr>\n											<tr class="odd">\n											<td>L</td>\n											<td>41 - 44</td>\n											<td>35 - 38</td>\n											<td>41 - 44</td>\n											</tr>\n											<tr>\n											<td>XL</td>\n											<td>44 - 48 1/2</td>\n											<td>38 - 43</td>\n											<td>44 - 47</td>\n											</tr>\n											<tr class="odd">\n											<td>XXL</td>\n											<td>48 1/2 - 53 1/2</td>\n											<td>43 - 47 1/2</td>\n											<td>47 - 50 1/2</td>\n											</tr>\n											<tr>\n											<td>XXXL</td>\n											<td>53 1/2 - 58</td>\n											<td>47 1/2 - 53 1/2</td>\n											<td>50 1/2 - 53 1/2</td>\n											</tr>\n											<tr class="odd">\n											<td>XXXXL</td>\n											<td>58 - 63</td>\n											<td>52 1/2 - 57</td>\n											<td>53 1/2 - 57</td>\n											</tr>\n											</tbody>\n										</table>\n									</div>\n<!-- SIZE TABLE BLOCK END -->\n', '2015-12-08 15:00:35', '2015-12-08 15:00:35', 1),
