(5, 'Enable Cookies', 'one_column', NULL, NULL, 'enable-cookies', NULL, '<div class="std">\n    <ul class="messages">\n        <li class="notice-msg">\n            <ul>\n                <li>Please enable cookies in your web browser to continue.</li>\n            </ul>\n        </li>\n    </ul>\n    <div class="page-title">\n        <h1><a name="top"></a>What are Cookies?</h1>\n    </div>\n    <p>Cookies are short pieces of data that are sent to your computer when you visit a website.\n    On later visits, this data is then returned to that website. Cookies allow us to recognize you automatically\n    whenever you visit our site so that we can personalize your experience and provide you with better service.\n    We also use cookies (and similar browser data, such as Flash cookies) for fraud prevention and other purposes.\n     If your web browser is set to refuse cookies from our website, you will not be able to complete a purchase\n     or take advantage of certain features of our website, such as storing items in your Shopping Cart or\n     receiving personalized recommendations. As a result, we strongly encourage you to configure your web\n     browser to accept cookies from our website.</p>\n    <h2 class="subtitle">Enabling Cookies</h2>\n    <ul class="disc">\n        <li><a href="#ie7">Internet Explorer 7.x</a></li>\n        <li><a href="#ie6">Internet Explorer 6.x</a></li>\n        <li><a href="#firefox">Mozilla/Firefox</a></li>\n        <li><a href="#opera">Opera 7.x</a></li>\n    </ul>\n    <h3><a name="ie7"></a>Internet Explorer 7.x</h3>\n    <ol>\n        <li>\n            <p>Start Internet Explorer</p>\n        </li>\n        <li>\n            <p>Under the <strong>Tools</strong> menu, click <strong>Internet Options</strong></p>\n            <p><img src="{{skin url="images/cookies/ie7-1.gif"}}" alt="" /></p>\n        </li>\n        <li>\n            <p>Click the <strong>Privacy</strong> tab</p>\n            <p><img src="{{skin url="images/cookies/ie7-2.gif"}}" alt="" /></p>\n        </li>\n        <li>\n            <p>Click the <strong>Advanced</strong> button</p>\n            <p><img src="{{skin url="images/cookies/ie7-3.gif"}}" alt="" /></p>\n        </li>\n        <li>\n            <p>Put a check mark in the box for <strong>Override Automatic Cookie Handling</strong>,\n            put another check mark in the <strong>Always accept session cookies </strong>box</p>\n            <p><img src="{{skin url="images/cookies/ie7-4.gif"}}" alt="" /></p>\n        </li>\n        <li>\n            <p>Click <strong>OK</strong></p>\n            <p><img src="{{skin url="images/cookies/ie7-5.gif"}}" alt="" /></p>\n        </li>\n        <li>\n            <p>Click <strong>OK</strong></p>\n            <p><img src="{{skin url="images/cookies/ie7-6.gif"}}" alt="" /></p>\n        </li>\n        <li>\n            <p>Restart Internet Explore</p>\n        </li>\n    </ol>\n    <p class="a-top"><a href="#top">Back to Top</a></p>\n    <h3><a name="ie6"></a>Internet Explorer 6.x</h3>\n    <ol>\n        <li>\n            <p>Select <strong>Internet Options</strong> from the Tools menu</p>\n            <p><img src="{{skin url="images/cookies/ie6-1.gif"}}" alt="" /></p>\n        </li>\n        <li>\n            <p>Click on the <strong>Privacy</strong> tab</p>\n        </li>\n        <li>\n            <p>Click the <strong>Default</strong> button (or manually slide the bar down to <strong>Medium</strong>)\n            under <strong>Settings</strong>. Click <strong>OK</strong></p>\n            <p><img src="{{skin url="images/cookies/ie6-2.gif"}}" alt="" /></p>\n        </li>\n    </ol>\n    <p class="a-top"><a href="#top">Back to Top</a></p>\n    <h3><a name="firefox"></a>Mozilla/Firefox</h3>\n    <ol>\n        <li>\n            <p>Click on the <strong>Tools</strong>-menu in Mozilla</p>\n        </li>\n        <li>\n            <p>Click on the <strong>Options...</strong> item in the menu - a new window open</p>\n        </li>\n        <li>\n            <p>Click on the <strong>Privacy</strong> selection in the left part of the window. (See image below)</p>\n            <p><img src="{{skin url="images/cookies/firefox.png"}}" alt="" /></p>\n        </li>\n        <li>\n            <p>Expand the <strong>Cookies</strong> section</p>\n        </li>\n        <li>\n            <p>Check the <strong>Enable cookies</strong> and <strong>Accept cookies normally</strong> checkboxes</p>\n        </li>\n        <li>\n            <p>Save changes by clicking <strong>Ok</strong>.</p>\n        </li>\n    </ol>\n    <p class="a-top"><a href="#top">Back to Top</a></p>\n    <h3><a name="opera"></a>Opera 7.x</h3>\n    <ol>\n        <li>\n            <p>Click on the <strong>Tools</strong> menu in Opera</p>\n        </li>\n        <li>\n            <p>Click on the <strong>Preferences...</strong> item in the menu - a new window open</p>\n        </li>\n        <li>\n            <p>Click on the <strong>Privacy</strong> selection near the bottom left of the window. (See image below)</p>\n            <p><img src="{{skin url="images/cookies/opera.png"}}" alt="" /></p>\n        </li>\n        <li>\n            <p>The <strong>Enable cookies</strong> checkbox must be checked, and <strong>Accept all cookies</strong>\n            should be selected in the &quot;<strong>Normal cookies</strong>&quot; drop-down</p>\n        </li>\n        <li>\n            <p>Save changes by clicking <strong>Ok</strong></p>\n        </li>\n    </ol>\n    <p class="a-top"><a href="#top">Back to Top</a></p>\n</div>\n', '2015-12-08 14:05:53', '2015-12-08 14:05:53', 1, 0, NULL, NULL, NULL, NULL, NULL, NULL),
(6, 'Policies- RentRam', 'two_columns_right', NULL, NULL, 'policy', 'Rentram Policy', '<!-- Post Content\r\n                    ============================================= -->\r\n<div class="topmargin-sm bottommargin-sm col-md-12">\r\n<!--\r\n<ul id="portfolio-filter" class="clearfix">\r\n<li class="activeFilter"><a href="#" data-filter=".pricing-policy">Pricing Policy</a></li>\r\n<li><a href="#" data-filter=".return-policy">Return/refund policy</a></li>\r\n<li><a href="#" data-filter=".damage-policy">Damages policy</a></li>\r\n<li><a href="#" data-filter=".cancellation-policy">Cancelation policy</a></li>\r\n<li><a href="#" data-filter=".installation-policy">Installation policy</a></li>\r\n<li><a href="#" data-filter=".payment-policy">Payment Policy</a></li>\r\n<li><a href="#" data-filter=".transport-policy">Transportation policy</a></li>\r\n</ul> -->\r\n<div class="clear">&nbsp;</div>\r\n<div id="faqs" class="faqs">\r\n\r\n<div class="toggle pricing-policy">\r\n<div class="togglet">Pricing Policy</div>\r\n<div class="togglec">\r\n<ul>\r\n<li>The price would be entirely decided by the seller/owner, which they would like to receive as rental fees.</li>\r\n<li>This price would be reflected in the RentRam.com This price does not include the Taxes.</li>\r\n<li>Helpful Resources for Authors</li>\r\n</ul>\r\n</div>\r\n</div>\r\n\r\n<div class="toggle return-policy">\r\n<div class="togglet">Return and refund policy</div>\r\n<div class="togglec">\r\n<ul>\r\n<li>The renter (one who pays the rent) has to give RentRam at least 1month of prior notice before returning back the rented item.</li>\r\n<li>When the item is delivered to the renter’s location, \r\n  the renter can return back the item within 5-6 hours in case of non-satisfactory performance of the product.</li>\r\n<li>Once the rented item is reviewed for damages, wear and tear the security deposit will be refunded with some adjustment.\r\n   In case of some damages, some small amount might be deducted from the amount. </li>\r\n<li>The rented items cannot be exchanged with a different item. \r\n  The renter (one who pays the rent) has to return the item and has to order a new one. </li>\r\n</ul>\r\n</div>\r\n</div>\r\n\r\n<div class="toggle damage-policy">\r\n<div class="togglet">Damages policy</div>\r\n<div class="togglec">\r\n<ul>\r\n<li>Incase of any technical error in the working of the product, the renter s shall contact RentRam. \r\n  RentRam will arrange a service for the item within 24-48 hrs. </li>\r\n<li>In case of loss or theft or damage which cannot be repaired, the renter has to pay for the damage.  \r\nThe damages will be measured by Rent Ram’s service boys. </li>\r\n<li>The RRC (RentRam Contract) which shall be signed by rentee, renter will have all the details, \r\n  of the product quality at the time of delivery to the renter . </li>\r\n</ul>\r\n</div>\r\n</div>\r\n\r\n<div class="toggle cancellation-policy">\r\n<div class="togglet">Cancellation policy</div>\r\n<div class="togglec">\r\n<ul>\r\n<li>The renter has to cancel an order within 5-6 hrs of delivery. </li>\r\n<li>In case of cancellation, the security amount and the payment would be refunded back to the renter within 24-48 hrs.\r\n   The renter would not be required to pay for the transportation.</li>\r\n</ul>\r\n</div>\r\n</div>\r\n\r\n<div class="toggle installation-policy">\r\n<div class="togglet">Installation policy</div>\r\n<div class="togglec">\r\n<ul>\r\n<li>RentRam.com shall be responsible to deliver the product safely to your doorstep. \r\n  The renter shall have to arrange for the installation of the electronics (Air Conditioner, TV etc) themselves. </li>\r\n<li>The renter shall bear any damage done to the item during installation. </li>\r\n</ul>\r\n</div>\r\n</div>\r\n\r\n<div class="toggle payment-policy">\r\n<div class="togglet">Payment Policy</div>\r\n<div class="togglec">\r\n<ul>\r\n<li>Renter has to initially deposit a security deposit of 1 month (for electronic items) and 2 months for furniture in advance.\r\n   Renter will also pay for the first month.\r\n <p>For eg on 1 Jan, Kamal  rents a TV for Rs 500 monthly .\r\n    Kamal would have to initially pay Rs 500 (security) + Rs 500 (Rent for Jan). Kamal’s next installment would be Rs 500 on 1 Feb</p></li>\r\n<li>The renter has to pay for the rent every 1 week of the month (the monthly rent) to RentRam.com. </li>\r\n<li>Failure to pay in the first week would lead to a penalty of Rs 100 to the renter. Failure to pay in the first two week would lead to a penalty of Rs 250 to the renter.</li>\r\n<li> The rent pick could be arranged by RentRam.com. Alternately, the renter can pay directly online via credit card/debit card/net banking/mobile wallets.</li>\r\n</ul>\r\n</div>\r\n</div>\r\n\r\n<div class="toggle payment-policy">\r\n<div class="togglet">Transportation policy</div>\r\n<div class="togglec">\r\n<p>The renter shall be given two choices- </p>\r\n<ul>\r\n<li>The renter can use RentRam’s transportation at pre-negotiated prices.\r\n   In this case RentRam.com would be responsible to deliver the product safely as renter’s doorstep.</li>\r\n<li>The renter can use their own transport/transporter. They can collect their items from RentRam.com’s office (after a pre-arranged delivery appointment made at RentRam’s helpline number). \r\n  The renter would be responsible, in case of any damages to the product during the delivery.</li>\r\n</ul>\r\n</div>\r\n</div>\r\n\r\n<script type="text/javascript">// <![CDATA[\r\njQuery(document).ready(function($){\r\n                                var $faqItems = $(''#faqs .faqs'');\r\n                                if( window.location.hash != '''' ) {\r\n                                    var getFaqFilterHash = window.location.hash;\r\n                                    var hashFaqFilter = getFaqFilterHash.split(''#'');\r\n                                    if( $faqItems.hasClass( hashFaqFilter[1] ) ) {\r\n                                        $(''#portfolio-filter li'').removeClass(''activeFilter'');\r\n                                        $( ''[data-filter=".''+ hashFaqFilter[1] +''"]'' ).parent(''li'').addClass(''activeFilter'');\r\n                                        var hashFaqSelector = ''.'' + hashFaqFilter[1];\r\n                                        $faqItems.css(''display'', ''none'');\r\n                                        if( hashFaqSelector != ''all'' ) {\r\n                                            $( hashFaqSelector ).fadeIn(500);\r\n                                        } else {\r\n                                            $faqItems.fadeIn(500);   \r\n                                        }\r\n                                    }                                    \r\n                                }\r\n\r\n                                $(''#portfolio-filter a'').click(function(){\r\n                                    $(''#portfolio-filter li'').removeClass(''activeFilter'');\r\n                                    $(this).parent(''li'').addClass(''activeFilter'');\r\n                                    var faqSelector = $(this).attr(''data-filter'');\r\n                                    $faqItems.css(''display'', ''none'');\r\n                                    if( faqSelector != ''all'' ) {\r\n                                        $( faqSelector ).fadeIn(500);\r\n                                    } else {\r\n                                        $faqItems.fadeIn(500);\r\n                                    }\r\n                                    return false;\r\n                               });\r\n                            });\r\n// ]]></script>\r\n</div>\r\n<!-- .postcontent end -->\r\n<p>&nbsp;</p>', '2015-12-08 14:05:54', '2016-01-17 03:04:04', 1, 0, NULL, NULL, NULL, NULL, NULL, NULL),
