(14, 'Icon boxes', 'one_column', NULL, NULL, 'icon-boxes', NULL, '                    <div class="fancy-title title-dotted-border">\r\n                        <h3>Normal Size Icons</h3>\r\n                    </div>\r\n\r\n                    <div class="col_one_third">\r\n                        <div class="feature-box fbox-effect">\r\n                            <div class="fbox-icon">\r\n                                <a href="#"><i class="icon-screen i-alt"></i></a>\r\n                            </div>\r\n                            <h3>Responsive Layout</h3>\r\n                            <p>Powerful Layout with Responsive functionality that can be adapted to any screen size. Resize browser to view.</p>\r\n                        </div>\r\n                    </div>\r\n\r\n                    <div class="col_one_third">\r\n                        <div class="feature-box fbox-effect">\r\n                            <div class="fbox-icon">\r\n                                <a href="#"><i class="icon-eye i-alt"></i></a>\r\n                            </div>\r\n                            <h3>Retina Ready Graphics</h3>\r\n                            <p>Looks beautiful &amp; ultra-sharp on Retina Screen Displays. Retina Icons, Fonts &amp; all others graphics are optimized.</p>\r\n                        </div>\r\n                    </div>\r\n\r\n                    <div class="col_one_third col_last">\r\n                        <div class="feature-box fbox-effect">\r\n                            <div class="fbox-icon">\r\n                                <a href="#"><i class="icon-beaker i-alt"></i></a>\r\n                            </div>\r\n                            <h3>Powerful Performance</h3>\r\n                            <p>Cleo includes tons of optimized code that are completely customizable and deliver unmatched fast performance.</p>\r\n                        </div>\r\n                    </div>\r\n\r\n                    <div class="clear"></div>\r\