ider"><i class="icon-circle"></i></div>\r\n\r\n                    <h3>Inline Counters</h3>\r\n\r\n                    <ul style="list-style: none;">\r\n                        <li>\r\n                            <div class="counter counter-inherit">Facebook has <code><span data-from="100" data-to="1255213212" data-refresh-interval="150" data-speed="10000"></span></code> Members</div>\r\n                        </li>\r\n                        <li>\r\n                            <div class="alert alert-warning">\r\n                                <div class="counter counter-inherit"><i class="icon-comments"></i><strong>Attention:</strong> You have <strong><span data-from="1" data-to="9" data-refresh-interval="150" data-speed="3000"></span></strong> unread messages.</div>\r\n                            </div>\r\n                        </li>\r\n                    </ul>\r\n\r\n                    <div class="divider"><i class="icon-circle"></i></div>\r\n\r\n                    <h3>Countdowns</h3>\r\n\r\n                    <div class="row">\r\n\r\n                        <div class="col-md-6 bottommargin">\r\n\r\n                            <div id="countdown-ex1" class="countdown"></div>\r\n\r\n                            <div class="line"></div>\r\n\r\n                            <div id="countdown-ex2" class="countdown countdown-medium"></div>\r\n\r\n                            <div class="line"></div>\r\n\r\n                            <div id="countdown-ex3" class="countdown countdown-large"></div>\r\n\r\n                            <script>\r\n                                jQuery(document).ready( function($){\r\n                                    var newDate = new Date(2016, 2, 31);\r\n                                    $(''#countdown-ex1'').countdown({until: newDate});\r\n                                    $(''#countdown-ex2'').countdown({until: newDate});\r\n                                    $(''#countdown-ex3'').countdown({until: newDate});\r\n                                });\r\n                            </script>\r\n\r\n                        </div>\r\n\r\n                        <div class="col-md-6">\r\n\r\n                            <h4>Inline Countdown</h4>\r\n\r\n                            <div class="alert alert-info">\r\n                                <div id="countdown-ex4" class="countdown countdown-inline"></div>\r\n                            </div>\r\n\r\n                            <div class="line"></div>\r\n\r\n                            <h4>Start Download Countdown</h4>\r\n\r\n                            <a id="start-downloadbtn" href="#" class="btn btn-success btn-lg">Start Download</a>\r\n\r\n                            <div id="start-download" class="alert alert-success" style="display: none; margin-top: 20px;">\r\n                                <strong>Please Wait!</strong> Your Download will start in <div id="countdown-ex5" class="countdown countdown-inline"></div>.\r\n                            </div>\r\n\r\n                            <script>\r\n                                jQuery(document).ready( function($){\r\n\r\n                                    var newDate4 = new Date(2016, 2, 31);\r\n                                    $(''#countdown-ex4'').countdown({until: newDate4});\r\n\r\n                                    $(''#start-downloadbtn'').click( function(){\r\n                                        $(''#start-downloadbtn'').fadeOut(300, function(){\r\n                                            $(''#start-download'').fadeIn(300, function(){\r\n                                                var currentDate = new Date();\r\n                                                currentDate.setSeconds(currentDate.getSeconds() + 10);\r\n                                                $(''#countdown-ex5'').countdown({\r\n                                                    until: currentDate,\r\n                                                    format: ''S'',\r\n                                                    expiryUrl: ''http://www.weltpixel.com/cleo-theme/cleo-theme.html'',\r\n                                                    onExpiry: function(){\r\n                                                        $(''#start-download'').html(''Your Download should start automatically. If it dosen\\''t, <a href="#" class="alert-link">click here</a>.'');\r\n                                                    }\r\n                                                });\r\n                                            });\r\n                                        });\r\n                                        return false;\r\n                                    });\r\n\r\n                                });\r\n                            </script>\r\n</div>\r\n</div>\r\n</div>', '2015-12-08 15:12:12', '2015-12-08 15:12:12', 1, 0, NULL, NULL, NULL, NULL, NULL, NULL);
