n                                </li>\r\n                                <li>\r\n                                    Magento Color Swatch\r\n                                </li>\r\n                                <li>\r\n                                    Footer Version 1\r\n                                </li>\r\n                            </ul>\r\n                        </div>\r\n                    </div>\r\n\r\n                    <div class="col-md-4 col-sm-12 col-xs-12">\r\n\r\n                        <div class="laptop-container">\r\n                            <a href="http://cleo.weltpixel.com/demo/demo-tf/index.html#V2" class="default link" target="_blank"> <span class="image-bg"> <img class="image-laoptop" src="http://www.weltpixel.com/images/demo/bg-macbook.png" title="Demo 2" alt="Demo 2" />\r\n                                <div class="image-scroll-wrapper">\r\n                                    <span class="image-shop-scroll" style="background-image: url(''http://www.weltpixel.com/images/demo/demo-2.jpg'')"></span>\r\n                                </div> <span class="glare"></span> </span> </a>\r\n                        </div>\r\n                        <div class="feature-box fbox-center fbox-bg fbox-outline fbox-dark fbox-effect">\r\n                            <div class="fbox-icon">\r\n                                <a href="http://cleo.weltpixel.com/demo/demo-tf/index.html#V2" target="_blank"><i class="i-alt">Demo 2</i></a>\r\n                            </div>\r\n                            <ul>\r\n                                <li>\r\n                                    1 Line Header\r\n                                </li>\r\n                                <li>\r\n                                    One Page Checkout\r\n                                </li>\r\n                                <li>\r\n                                    Homepage Version 2\r\n                                </li>\r\n                                