(43, 'FAQ- Rentram', 'two_columns_right', NULL, NULL, 'rentram-faq', NULL, '<!-- Post Content\r\n                    ============================================= -->\r\n<div class="topmargin-sm bottommargin-sm col-md-12">\r\n<div id="faqs" class="faqs">\r\n<div id="faqs-list" class="fancy-title title-bottom-border">\r\n<h3>Some of your Questions:</h3>\r\n</div>\r\n<ul class="iconlist faqlist">\r\n<li><strong><a href="#" data-scrollto="#faq-1">How does it work?</a></strong></li>\r\n<li><strong><a href="#" data-scrollto="#faq-2">Can I also rent out my items?</a></strong></li>\r\n<li><strong><a href="#" data-scrollto="#faq-3">why should I rent ?</a></strong></li>\r\n<li><strong><a href="#" data-scrollto="#faq-4">Do I need to sign a contract?  What will be the minimum tenure/lock in period of the contract?</a></strong></li>\r\n<li><strong><a href="#" data-scrollto="#faq-5">How is the rent calculated?</a></strong></li>\r\n<li><strong><a href="#" data-scrollto="#faq-6">Do I need to provide any documents at the time of delivery?</a></strong></li>\r\n<li><strong><a href="#" data-scrollto="#faq-7">Do I have to pay for transport?</a></strong></li>\r\n<li><strong><a href="#" data-scrollto="#faq-8">How do you calculate the transportation charges?</a></strong></li>\r\n<li><strong><a href="#" data-scrollto="#faq-9">Which cities do we operate in?</a></strong></li>\r\n<li><strong><a href="#" data-scrollto="#faq-10">Why do I need to create an account before ordering the item?</a></strong></li>\r\n<li><strong><a href="#" data-scrollto="#faq-11">Does RentRam.com ensure quality check of the products before delivering?</a></strong></li>\r\n<li><strong><a href="#" data-scrollto="#faq-12"> How much would I need to pay initially?</a></strong></li>\r\n<li><strong><a href="#" data-scrollto="#faq-13">How do I pay for the rent monthly?</a></strong></li>\r\n<li><strong><a href="#" data-scrollto="#faq-14">What happens if I fail to pay on time?</a></strong></li>\r\n<li><strong><a href="#" data-scrollto="#faq-15">Can I upgrade/modify the item anytime?</a></strong></li>\r\n<li><strong><a href="#" data-scrollto="#faq-16">What happens if the product stops working or is not working properly?</a></strong></li>\r\n<li><strong><a href="#" data-scrollto="#faq-17">How do I return the product?</a></strong></li>\r\n<li><strong><a href="#" data-scrollto="#faq-18">Will I get full refund of my security deposit?</a></strong></li>\r\n<li><strong><a href="#" data-scrollto="#faq-19">When is the money returned?</a></strong></li>\r\n\r\n</ul>\r\n<div class="divider">&nbsp;</div>\r\n<h3 id="faq-1"><strong>Q.</strong> How does it work?</h3>\r\n<p><span style="text-decoration: underline;"><strong>Offer</strong></span> &ndash; A registered seller or a user (who wants to rent out their item) can list their items on RentRam.com. They input the price, availability, description and age of the item themselves. Once approved by a RentRam.com&rsquo;s representative the offer will be listed in the website</p>\r\n<p><span style="text-decoration: underline;"><strong>Browse</strong></span> &ndash; The customer shall browse though the RentRam&rsquo;s list of rental items. The uses select the items to rent. The customers pay&rsquo;s against the rented items.</p>\r\n<p><span style="text-decoration: underline;"><strong>Rent</strong></span> &ndash; The item then shall be delivered to the renter&rsquo;s place. The renter enjoys the service of the product till his desired tenure. The renter then returns the item back. &nbsp;</p>\r\n<div class="divider divider-right">&nbsp;</div>\r\n\r\n<h3 id="faq-2"><strong>Q.</strong> Can I also rent out my items?</h3>\r\n<p>Yes, anyone can offer their products on rent and start earning a monthly income.  You have to register on the website and then place and advertisement (which is free of cost) on RentRam.com and start renting. </p>\r\n<div class="divider divider-right">&nbsp;</div>\r\n\r\n<h3 id="faq-3"><strong>Q.</strong> Why should I rent ?</h3>\r\n<p>Instead of using you money in buying new items, you could just rent these from RentRam.com and save that money for some other use. Instead of buying a second hand product, which could be unreliable and could have very high maintenance, you could just rent these items from RentRam.com and save yourself from headaches. \r\nMoreover, as RentRam.com does not have any minimum lock in period you can also upgrade your item periodically for more enjoyment or better services. </p>\r\n<div class="divider divider-right">&nbsp;</div>\r\n\r\n<h3 id="faq-4"><strong>Q.</strong> Do I need to sign a contract?  What will be the minimum tenure/lock in period of the contract?</h3>\r\n<p>Yes, you would need to a sign a RRC (RentRam Contract). There is no minimum tenure or lock in period of the contract. You can avail the rented item as long as you want to avail. However, for returning the item back you would have to inform RentRam.com on the helpline number or via email atleast 1 month in advance.</p>\r\n\r\n<div class="divider divider-right">&nbsp;</div>\r\n<h3 id="faq-5"><strong>Q.</strong>How is the rent calculated?</h3>\r\n<p>RentRam.com does not calculate the rent. It is an online marketplace where the sellers themselves place the advertisement and put the rent prices themselves.</p>\r\n<div class="divider divider-right">&nbsp;</div>\r\n\r\n<h3 id="faq-6"><strong>Q.</strong>Do I need to provide any documents at the time of delivery?</h3>\r\n<p>Yes, you would need to \r\na) provide a photocopy of at least 1 government Photo id such as aadhar card,  passport, driving license or Pan card.\r\nb) Photocopy of the house rent agreement or the postpaid mobile bill (of the last month)</p>\r\n<div class="divider divider-right">&nbsp;</div>\r\n\r\n<h3 id="faq-7"><strong>Q.</strong> Do I have to pay for transport?</h3>\r\n<p>Yes,  you have an option to choose between RentRam.com’s pre-negotiated prices with the transporters or you can arrange a delivery from RentRam.com’s premises yourself .</p>\r\n<div class="divider divider-right">&nbsp;</div>\r\n\r\n<h3 id="faq-8"><strong>Q.</strong>How do you calculate the transportation charges?</h3>\r\n<p>The transportation charges are calculated according to the distance the transporter has to cover to deliver the item. The start point would be the seller’s location and the destination would be the renter’s location.</p>\r\n<div class="divider divider-right">&nbsp;</div>\r\n\r\n<h3 id="faq-9"><strong>Q.</strong> Which cities do we operate in?</h3>\r\n<p>We are currently operating in Delhi NCR and Jaipur. </p>\r\n<div class="divider divider-right">&nbsp;</div>\r\n\r\n<h3 id="faq-10"><strong>Q.</strong>Why do I need to create an account before ordering the item?</h3>\r\n<p>It is required to register a free account with RentRam.com, so that we can monitor your transactions and your products regularly and give a better service. </p>\r\n<div class="divider divider-right">&nbsp;</div>\r\n\r\n<h3 id="faq-11"><strong>Q.</strong>Does RentRam.com ensure quality check of the products before delivering?</h3>\r\n<p>Yes, at RentRam.com we have 2 layers of quality check before it is delivered to the renter (the one who pays the rent)</p>\r\n<div class="divider divider-right">&nbsp;</div>\r\n\r\n\r\n<h3 id="faq-12"><strong>Q.</strong> How much would I need to pay initially?</h3>\r\n<p>Renter has to initially deposit a security deposit of 1 month for electronic items and 2 months for furniture in advance. Renter will also pay for the first month. </p>\r\n<p>For eg on 1 Jan, Kamal rents a TV for Rs 500 monthly. Kamal would have to initially pay Rs 500 (security) + Rs 500 (Rent for Jan). Kamal’s next installment would be Rs 500 on 1 Feb</p>\r\n<div class="divider divider-right">&nbsp;</div>\r\n\r\n\r\n<h3 id="faq-13"><strong>Q.</strong>How do I pay for the rent monthly?</h3>\r\n<p>The renter has to pay for the rent every 1 week of the month (the monthly rent) to RentRam.com.  The rent pick could be arranged by RentRam.com. Alternately, the renter can pay directly online via credit card/debit card/net banking/mobile wallets. </p>\r\n<div class="divider divider-right">&nbsp;</div>\r\n\r\n\r\n<h3 id="faq-14"><strong>Q.</strong>What happens if I fail to pay on time?</h3>\r\n<p>Failure to pay in the first week would lead to a penalty of Rs 100 to the renter. Failure to pay in the first two week would lead to a penalty of Rs 250 to the renter. In case of more delay the product would be taken back by the RentRam team and the security deposit will be fortified. </p>\r\n<div class="divider divider-right">&nbsp;</div>\r\n\r\n\r\n<h3 id="faq-15"><strong>Q.</strong>Can I upgrade/modify the item anytime?</h3>\r\n<p>In this case you would have to give a prior notice of 1 month to return the product. Then you would browse through the website for a new product of your choice. \r\nYou can order again.</p>\r\n<div class="divider divider-right">&nbsp;</div>\r\n\r\n\r\n<h3 id="faq-16"><strong>Q.</strong>What happens if the product stops working or is not working properly?</h3>\r\n<p>You need to call us on our helpline number. Our representative would arrange a technician to come to your place and repair the item.  You would not need to pay for the repair, unless it’s a faulty part or any other technical issue.  In case of damages please see our damage policy. </p>\r\n<div class="divider divider-right">&nbsp;</div>\r\n\r\n\r\n<h3 id="faq-17"><strong>Q.</strong>How do I return the product?</h3>\r\n<p>You would have to inform the RentRam team at our helpline number that you would like to return the product. You will receive a confirmation email, which will have the returning terms and the specified date of return.</p>\r\n<div class="divider divider-right">&nbsp;</div>\r\n\r\n\r\n<h3 id="faq-18"><strong>Q.</strong>Will I get full refund of my security deposit?</h3>\r\n<p >Yes, ideally you would get full return of your security deposit. However, in case of damages small amount would be deducted from the deposit. For more details please read our return and refund policy.</p>\r\n<div class="divider divider-right">&nbsp;</div>\r\n\r\n<h3 id="faq-19"><strong>Q.</strong>When is the money returned?</h3>\r\n<p class="nobottommargin">The money is returned within 24-48 hrs of the product pick up from the customer’s location. </p>\r\n</div>\r\n</div>\r\n<!-- .postcontent end -->\r\n<p>&nbsp;</p>', '2015-12-08 15:12:21', '2016-01-17 02:29:28', 1, 0, NULL, NULL, NULL, NULL, NULL, NULL),
