(46, 'Demo', 'full_screen', NULL, NULL, 'demo-intro', NULL, '<section id="slider" class="slider-parallax full-screen">\r\n    <div class="full-screen" style="background: url(''http://cleo.weltpixel.com/images/demo-intro/hero.jpg''); background-size: cover;">\r\n        <div class="clearfix">\r\n\r\n            <img src="http://cleo.weltpixel.com/images/demo-intro/iPhone_hand.png" alt="Image" class="hidden-sm hidden-xs" data-style-lg="position: absolute; left: 0; bottom: 0; height: auto;" data-style-md="position: absolute; left: 0; bottom: 0; width: 100%;">\r\n\r\n            <div class="vertical-middle no-fade">\r\n                <div class="col-md-6 fright nobottommargin" data-animate="fadeIn">\r\n\r\n                    <div class="emphasis-title">\r\n                        <h1 data-style-lg="font-size: 52px;" data-style-md="font-size: 44px;">Optimize your Magento websites!\r\n                        <br>\r\n                        Use <img src="http://cleo.weltpixel.com/skin/frontend/cleo/default/images/logo.png" style="width: 130px;margin: -10px 20px 0 20px;">Theme</h1>\r\n                    </div>\r\n\r\n                    <div class="hidden-xs">\r\n                        <a href="#" class="wp-button wp-button-desc wp-button-border wp-button wp-button-rounded nomargin" data-scrollto="#section-pricing" data-easing="easeInOutExpo" data-speed="1250" data-offset="50"><i class="icon-cart"></i>\r\n                        <div>\r\n                            Buy Now!<span>15-Days Returns</span>\r\n                        </div></a>\r\n                    </div>\r\n\r\n                    <div class="visible-xs">\r\n                        <a href="#" class="wp-button wp-button wp-button-xlarge wp-button-rounded nomargin" data-scrollto="#section-pricing" data-easing="easeInOutExpo" data-speed="1250" data-offset="50"><i class="icon-cart"></i>Buy Now</a>\r\n                    </div>\r\n\r\n                </div>\r\n            </div>\r\n\r\n        </div>\r\n    </