     }\r\n            /*@media (max-width: 800px) {*/\r\n                .col-sm-12 {\r\n                      width: 100%;\r\n                      max-height: 665px;\r\n                      height: auto;\r\n                    }\r\n            /*}*/\r\n           @media (min-width: 992px) {\r\n                .col-sm-12 {\r\n                    width: 33%;\r\n                  max-height: 665px;\r\n                  height: auto;\r\n                }\r\n            }\r\n            @media (max-width: 635px) {\r\n                .row .image-scroll-wrapper {\r\n                    height: 77%;\r\n                   /* top: -90%;*/\r\n                }\r\n            }\r\n            @media (max-width: 625px) {\r\n                .row .image-scroll-wrapper {\r\n                    /*height: 74%;\r\n                    top: -89%;*/\r\n                }\r\n                .image-bg .glare {\r\n                    right: -45px;\r\n                }\r\n            }\r\n            @media (max-width: 600px) {\r\n                .row .image-scroll-wrapper {\r\n                   /*height: 70%;\r\n                    top: -85%;\r\n                    margin-bottom: 10px;*/\r\n                }\r\n            }\r\n\r\n            @media (max-width: 580px) {\r\n                .row .image-scroll-wrapper {\r\n                    /*height: 70%;\r\n                    top: -83%;\r\n                    margin-bottom: 10px;*/\r\n                }\r\n            }\r\n            @media (max-width: 565px) {\r\n                .row .image-scroll-wrapper {\r\n                    /*height: 66%;\r\n                    top: -80%;\r\n                    margin-bottom: 25px;*/\r\n                }\r\n            }\r\n            @media (max-width: 535px) {\r\n                .row .image-scroll-wrapper {\r\n                   /*height: 61%;\r\n                    top: -74%;\r\n                    margin-bottom: 45px;*/\r\n                }\r\n            }\r\n\r\n            @media (max-width: 500px) {\r\n                .row .image-scroll-wrapper {\r\n                    /*height: 57%;\r\n                    top: -69%;\r\n                    margin-bottom: 58px;*/\r\n                }\r\n            }\r\n\r\n            @media (max-width: 479px) {\r\n                .feature-box.fbox-bg.fbox-center {\r\n                    background-color: rgba(255, 255, 255, 0.85);\r\n                    border: 1px solid #E5E5E5;\r\n                    border-radius: 5px;\r\n                    width: 90%;\r\n                    left: 0;\r\n                    margin: -0px auto 50px;\r\n                    position: relative;\r\n                    /*top: -210px;*/\r\n                }\r\n                .row .image-scroll-wrapper {\r\n                    margin-bottom: 0;\r\n                }\r\n                .image-bg .image-shop-scroll {\r\n                    background-repeat: no-repeat;\r\n                    height: 100%;\r\n                    left: 0;\r\n                    /*top: 12px;*/\r\n                    width: 100%;\r\n                    background-size: cover;\r\n                    margin-bottom: 0;\r\n                }\r\n            }\r\n            @media (max-width: 320px) {\r\n                .row .image-scroll-wrapper {\r\n                /*height: 37%;\r\n                top: -44%;*/\r\n                }\r\n                .feature-box.fbox-bg.fbox-center {\r\n                    top: -190px;\r\n                }\r\n            }\r\n                \r\n            @media (max-width: 300px) {\r\n                .row .image-scroll-wrapper {\r\n                /*height: 33%;\r\n                top: -40%;*/\r\n                }\r\n                .feature-box.fbox-bg.fbox-center {\r\n                      top: -200px;\r\n                    }\r\n            }\r\n            /* <<< demo laptops new styles */\r\n\r\n        </style>\r\n\r\n    </div>\r\n</div>\r\n\r\n<div id="section-pricing">\r\n\r\n    <div class="row clearfix w">\r\n\r\n        <div class="heading-title center">\r\n            <h2>Cleo Theme makes your store look and feel\r\n            <br>\r\n            clean and elegant</h2>\r\n        </div>\r\n\r\n        <p class="subtitle-txt">\r\n            Cleo is a flexible and complex theme, with very customizable extensions. Based on the latest version of Bootstrap framework, Cleo features a smart responsive design with powerful extensions included out of the box.\r\n        </p>\r\n\r\n        <!-- end w -->\r\n    </div>\r\n\r\n</div>\r\n\r\n<style>\r\n    #section-pricing {\r\n        background-color: #F9F9F9;\r\n        padding: 10px 0 50px 0;\r\n        border-top: 1px solid #eee;\r\n        border-bottom: 1px solid #eee;\r\n    }\r\n</style>\r\n<div id="owl-brand" class="owl-carousel">\r\n    <div class="item"><img  src="http://cleo.weltpixel.com/images/demo-intro/product_screen.png"  alt="Product Page">\r\n    </div>\r\n    <div class="item"><img  src="http://cleo.weltpixel.com/images/demo-intro/menu_screen.png"  alt="Menu">\r\n    </div>\r\n    <div class="item"><img  src="http://cleo.weltpixel.com/images/demo-intro/filter_screen.png"  alt="Filter">\r\n    </div>\r\n    <div class="item"><img  src="http://cleo.weltpixel.com/images/demo-intro/cart_screen.png"  alt="Cart">\r\n    </div>\r\n    <div class="item"><img  src="http://cleo.weltpixel.com/images/demo-intro/checkout_screen.png"  alt="Checkout">\r\n    </div>\r\n    <div class="item"><img  src="http://cleo.weltpixel.com/images/demo-intro/landing_screen.png"  alt="Home Page">\r\n    </div>\r\n</div>\r\n\r\n<style>\r\n    .owl-item {\r\n        padding: 50px;\r\n    }\r\n\r\n    #owl-brand {\r\n        background-color: #333;\r\n    }\r\n\r\n    #owl-brand .item {\r\n        margin: 0 !important;\r\n        padding: 0 !important;\r\n    }\r\n\r\n    #owl-brand .owl-buttons {\r\n        display: block !important;\r\n    }\r\n</style>\r\n\r\n<script type="text/javascript">\r\n    // <![CDATA[\r\n    jQuery(document).ready(function($) {\r\n        var owl = $("#owl-brand");\r\n        owl.owlCarousel({\r\n            items : 5,\r\n            pagination : false,\r\n            rewindNav : true,\r\n            navigation : true,\r\n            itemsDesktopSmall : [979, 5],\r\n            itemsMobile : [479, 2],\r\n            navigationText : [''<i class="ion-ios7-arrow-left"></i>'', ''<i class="ion-ios7-arrow-right"></i>'']\r\n        });\r\n    });\r\n    // ]]>\r\n</script>\r\n\r\n<div class="section nobottommargin notopmargin notoppadding" style="border-bottom: 1px solid #eee;">\r\n    <div class="w clearfix">\r\n\r\n        <div class="row topmargin-lg bottommargin-sm">\r\n\r\n            <div class="heading-title center">\r\n                <h2>Features adapted to the 2015’s ECOMMERCE market</h2>\r\n                <p class="subtitle-txt">\r\n                    Developed by Certified Magento Developers, Cleo integrates stunning features that help you really customize your solution and offer an absolute smooth user experience for your clients.\r\n                </p>\r\n            </div>\r\n\r\n            <div class="col-4 col-md-4 col-sm-6 bottommargin">\r\n\r\n                <div class="feature-box fbox-right topmargin" data-animate="fadeIn">\r\n                    <div class="fbox-icon">\r\n                        <a href="#"><i class="icon-line-heart"></i></a>\r\n                    </div>\r\n                    <h3>Translation Ready</h3>\r\n                    <p>\r\n                        Multi-Store, Multi-Language and Multi-Concurrency ready\r\n                    </p>\r\n                </div>\r\n\r\n                <div class="feature-box fbox-right topmargin" data-animate="fadeIn" data-delay="200">\r\n                    <div class="fbox-icon">\r\n                        <a href="#"><i class="icon-line-paper"></i></a>\r\n                    </div>\r\n                    <h3>Extensive Documentation</h3>\r\n                    <p>\r\n                        We have covered each &amp; everything in our Docs including Videos &amp; Screenshots.\r\n                    </p>\r\n                </div>\r\n\r\n                <div class="feature-box fbox-right topmargin" data-animate="fadeIn" data-delay="400">\r\n                    <div class="fbox-icon">\r\n                        <a href="#"><i class="icon-line-layers"></i></a>\r\n                    </div>\r\n                    <h3>LookBooks</h3>\r\n                    <p>\r\n                        Display your Content attractively using Parallax Sections with HTML5 Videos.\r\n                    </p>\r\n                </div>\r\n\r\n            </div>\r\n\r\n            <div class="col-4 col-md-4 hidden-sm bottommargin center">\r\n                <img class="image-fade" src="http://cleo.weltpixel.com/images/demo-intro/gif_pages.gif" alt="iphone 2">\r\n            </div>\r\n\r\n            <div class="col-4 col-md-4 col-sm-6 bottommargin">\r\n\r\n                <div class="feature-box topmargin" data-animate="fadeIn">\r\n                    <div class="fbox-icon">\r\n                        <a href="#"><i class="icon-line-power"></i></a>\r\n                    </div>\r\n                    <h3>Custom page width</h3>\r\n                    <p>\r\n                        Canvas provides support for Native HTML5 Videos that can be added to a Background.\r\n                    </p>\r\n                </div>\r\n\r\n                <div class="feature-box topmargin" data-animate="fadeIn" data-delay="200">\r\n                    <div class="fbox-icon">\r\n                        <a href="#"><i class="icon-line-check"></i></a>\r\n                    </div>\r\n                    <h3>Sell Anything</h3>\r\n                    <p>\r\n                        Simple, Configurable, Bundle and Grouped Products Ready!\r\n                    </p>\r\n                </div>\r\n\r\n                <div class="feature-box topmargin" data-animate="fadeIn" data-delay="400">\r\n                    <div class="fbox-icon">\r\n                        <a href="#"><i class="icon-bulb"></i></a>\r\n                    </div>\r\n                    <h3>Unlimited Sliders</h3>\r\n                    <p>\r\n                        Highlight your key content or special offers! Revolution Slider Included\r\n                    </p>\r\n                </div>\r\n\r\n            </div>\r\n\r\n        </div>\r\n\r\n    </div>\r\n</div>\r\n\r\n<div class="row clearfix w">\r\n    <div class="heading-title center">\r\n        <h2>Customers love user friendly websites! </h2>\r\n    </div>\r\n\r\n    <div class="col-md-6">\r\n        <img src="http://cleo.weltpixel.com/images/demo-intro/3_iphones.png" class="margin image-fade">\r\n    </div>\r\n\r\n    <div class="col-md-6">\r\n        <p class="subtitle-txt">\r\n            To increase your revenues and avoid store bounce rate, your customers need to have an obvious, simple path from your website entrance to the product they are looking for. We spent many hours optimizing the layered navigation for mobile devices as well. The price slider along with the swatch options will offer your customers a second to none user experience.\r\n        </p>\r\n    </div>\r\n\r\n    <!-- end w -->\r\n</div>\r\n\r\n<div class="toggle">\r\n\r\n    <div class="togglet wp-button wp-button-full wp-button-dark center bottommargin-lg">\r\n\r\n        <div class="container clearfix">\r\n            More than 27+ design feature. View them all!\r\n        </div>\r\n    </div>\r\n\r\n    <div class="togglec" id="weltpixel_features" style="display: none;">\r\n        {{block type="cms/block" block_id="weltpixel_features"}}\r\n    </div>\r\n</div>\r\n\r\n<div class="row clearfix w">\r\n\r\n    <div class="col-md-4 col-sm-12 col-xs-12">\r\n\r\n        <img alt="Fashion Box" class="image-fade" src="http://cleo.weltpixel.com/images/demo-intro/unlimited_colors.png">\r\n\r\n        <div class="heading-title center">\r\n            <h3>Unlimited Colors</h3>\r\n            <span class="center">Change the appearance of almost every element with a click on the color picker – no CSS knowledge required! You can simply change the color of all parameters: body, header, footer simply from the admin.</span>\r\n        </div>\r\n    </div>\r\n\r\n    <div class="col-md-4 col-sm-12 col-xs-12">\r\n\r\n        <img alt="Fashion Box" class="image-fade" src="http://cleo.weltpixel.com/images/demo-intro/newsletter_popup.png">\r\n\r\n        <div class="heading-title center">\r\n            <h3>Newsletter Popup</h3>\r\n            <span class="center">You can easily set after how many page views as well as time spent on the website you want to display the pop-up box. You can fully control the appearance of your popups by defining the following options: Display pages, Enable/Disable for mobile customers, pages before display, seconds before display, and many more...</span>\r\n        </div>\r\n    </div>\r\n\r\n    <div class="col-md-4 col-sm-12 col-xs-12">\r\n\r\n        <img style="box-shadow: 0 0 20px -5px #ccc;" alt="Fashion Box" class="image-fade" src="http://cleo.weltpixel.com/images/demo-intro/search_results.png">\r\n\r\n        <div class="heading-title center">\r\n            <h3>Search Result Autosuggest</h3>\r\n            <span class="center">Provide the most relevant search results after the third character is entered with this great feature! With the search preview showing store items matching search terms, customers can easily navigate to the desired product page. The fast and convenient Search Autocomplete  and Suggest will enable your customers to view the list of suggestions based on any attribute such as product name, description, SKU, meta data, etc.</span>\r\n        </div>\r\n    </div>\r\n\r\n    <div class="col-md-4 col-sm-12 col-xs-12">\r\n\r\n        <img style="box-shadow: 0 0 20px -5px #ccc;" alt="Fashion Box" class="image-fade" src="http://cleo.weltpixel.com/images/demo-intro/one_page_checkout.png">\r\n\r\n        <div class="heading-title center">\r\n            <h3>One Page Checkout</h3>\r\n            <span class="center">Reduce checkout process from 6 to 1 step. By making checkout easier for customers, you will increase your revenue and conversion rate. Allows customers to use saved contact information.  Autocomplete is enabled to allow customers to swiftly complete information fields with stored information from their browser.</span>\r\n        </div>\r\n    </div>\r\n\r\n    <div class="col-md-4 col-sm-12 col-xs-12">\r\n\r\n        <img alt="Fashion Box" class="image-fade" src="http://cleo.weltpixel.com/images/demo-intro/multiple_headers.png">\r\n\r\n        <div class="heading-title center">\r\n            <h3>Multiple Header Styles</h3>\r\n            <span class="center">Cleo has three types of header layouts to match any designs. The sticky header and the transparency option will make your website look clean and elegant.</span>\r\n        </div>\r\n    </div>\r\n\r\n    <div class="col-md-4 col-sm-12 col-xs-12">\r\n\r\n        <img style="box-shadow: 0 0 20px -5px #ccc;" alt="Fashion Box" class="image-fade" src="http://cleo.weltpixel.com/images/demo-intro/instagram.png">\r\n\r\n        <div class="heading-title center">\r\n            <h3>Instagram Feed</h3>\r\n            <span class="center">Source social content in real-time for your customers.</span>\r\n        </div>\r\n    </div>\r\n\r\n</div>\r\n\r\n<!-- end wrapper -->\r\n\r\n<div class="section parallax nobottommargin" style="background-image: url(''http://www.weltpixel.com/cleo/cleo/assets/bg.jpg''); padding: 100px 0;" data-stellar-background-ratio="0.4">\r\n\r\n    <div class="heading-block center">\r\n        <h3>Who is using CLEO?</h3>\r\n    </div>\r\n\r\n    <div class="fslider testimonial testimonial-full" data-animation="fade" data-arrows="false">\r\n        <div class="flexslider">\r\n            <div class="slider-wrap">\r\n                <div class="slide">\r\n                    <div class="testi-image">\r\n                        <a href="http://www.kicksusa.com" target="_blank"><img src="http://www.weltpixel.com/images/demo/kicksusa.gif" alt="KicksUSA"></a>\r\n                    </div>\r\n                    <div class="testi-content">\r\n                        <p>\r\n                            KicksUSA is a very popular urban footwear and apparel retailer from the East Coast. They decided to take Cleo as foundation of their front-end experience and combine it additional WeltPixel solutions to deliver an outstanding e-commerce solution.\r\n                        </p>\r\n                        <div class="testi-meta">\r\n                            Magento Enterprise Edition\r\n                        </div>\r\n                    </div>\r\n                </div>\r\n                <div class="slide">\r\n                    <div class="testi-image">\r\n                        <a href="http://www.portobrazil.net/" target="_blank"><img src="http://www.weltpixel.com/images/demo/portobrazil.png" alt="Porto Brazil"></a>\r\n                    </div>\r\n                    <div class="testi-content">\r\n                        <p>\r\n                            Porto Brazil is a Brazilian trademark providing exclusive bikinis, swimsuits and beachwear. They incorporated a configurable bundle feature that allows them to create extremely configurable products.\r\n                        </p>\r\n                        <div class="testi-meta">\r\n                            Magento Community Edition\r\n                        </div>\r\n                    </div>\r\n                </div>\r\n            </div>\r\n        </div>\r\n    </div>\r\n\r\n</div>\r\n\r\n<style>\r\n    .testi-image img {\r\n        border-radius: 0;\r\n        width: 200px !important;\r\n        height: auto !important;\r\n        margin-left: -60px;\r\n    }\r\n\r\n</style>', '2015-12-08 15:12:23', '2015-12-08 15:12:23', 1, 0, NULL, NULL, NULL, NULL, NULL, NULL);
