(1, 'Customer email after payment', '<!DOCTYPE html PUBLIC "-//W3C//DTD XHTML 1.0 Strict//EN" "http://www.w3.org/TR/xhtml1/DTD/xhtml1-strict.dtd">\r\n<html xmlns="http://www.w3.org/1999/xhtml">\r\n<head>\r\n    <meta http-equiv="Content-Type" content="text/html; charset=utf-8" />\r\n    <meta name="viewport" content="initial-scale=1.0, width=device-width" />\r\n</head>\r\n<body>\r\n{{var non_inline_styles}}\r\n<div style="align:center;    margin: 20px;">\r\n	<table cellpadding="0" cellspacing="0" border="0" align="center" class="container-table">\r\n			<tr>\r\n				 <td colspan="3">\r\n                     Hello {{htmlescape var=$order.getCustomerName()}}\r\n                 </td>\r\n			</tr>\r\n			<tr>\r\n				<td style="width:15%;"></td>\r\n				<td class="logo" style="width:15%;">\r\n					<a href="{{store url=""}}">\r\n                              <img {{if logo_width}}  width="{{var logo_width}}"\r\n                                       {{else}}  width="165"  {{/if}}\r\n                                       {{if logo_height}}  height="{{var logo_height}}"\r\n                                      	{{else}}  height="48"\r\n                                        {{/if}} src="{{var logo_url}}"  alt="{{var logo_alt}}"\r\n                                            border="0"/>\r\n                     </a>\r\n				</td>\r\n{{inlinecss file="email-inline.css"}}\r\n			 	<td style="text-align: left !important;" class="order-details">\r\n	           		 <h3>Your order <span class="no-link">#{{var order.increment_id}}</span></h3>\r\n	           		 <p>Placed on {{var order.getCreatedAtFormated(''long'')}}</p>\r\n	        	</td>\r\n		\r\n			</tr>\r\n			<tr>\r\n				<td colspan="3">\r\n					<p>Thank you for your rent order for "text from product header". \r\n					The Rentram contract would be send to you at the time of product delivery</p>\r\n				</td>\r\n			</tr>\r\n			<tr>\r\n				<td colspan="3">\r\n					Rent Order Summary\r\n				</td>\r\n			</tr>{{htmlescape var=$order.getCustomerName()}}\r\n			<tr>\r\n				<td>\r\n					Seller:<br/>\r\n					Transaction id :<br/>\r\n					Product category : <br/>\r\n					Product description :<br/>\r\n					Monthly Rent :<br/>\r\n					Advance deposit : <br/>\r\n					Subtotal : <br/>	<br/>\r\n					Renram transportation booked : yes/no\r\n				</td>\r\n				<td colspan="2">		\r\n						 Order places on :<br/>\r\n						 Quantity : <br/>\r\n				</td>\r\n			</tr>\r\n			<tr>\r\n				<td colspan="3">\r\n					<p>\r\n						<a href="#">Need to make changes to your order? Visit our Help Page for more information. </a>\r\n					</p>\r\n					<p>\r\n					Incase you are using the Rentram transportation service, our representative will be in\r\n					 touch with you shortly for a product delivery time slot booking. \r\n					In other case please call our helpline number to book a time for collection of the product from our office.\r\n					</p>\r\n				</td>\r\n				\r\n			</tr>\r\n			<tr>\r\n				<td>\r\n				</td>\r\n				<td colspan="2">\r\n					 Like Rentram.com?Connect with us! \r\n					 <img src="facebook"></img>\r\n					 <img src="twitter"></img>\r\n				</td>\r\n			</tr>\r\n{{template config_path="design/email/footer"}}', NULL, 2, 'Your Rentram.com order of  # {{var order.increment_id}}  is confirmed :', NULL, NULL, '2016-01-16 01:36:35', '2016-01-23 06:49:10', 'sales_email_order_template', '{"store url=\\"\\"":"Store Url",\r\n"var logo_url":"Email Logo Image Url",\r\n"var logo_alt":"Email Logo Image Alt",\r\n"htmlescape var=$order.getCustomerName()":"Customer Name",\r\n"var store.getFrontendName()":"Store Name",\r\n"store url=\\"customer/account/\\"":"Customer Account Url",\r\n"var order.increment_id":"Order Id",\r\n"var order.getCreatedAtFormated(''long'')":"Order Created At (datetime)",\r\n"var order.getBillingAddress().format(''html'')":"Billing Address",\r\n"var payment_html":"Payment Details",\r\n"var order.getShippingAddress().format(''html'')":"Shipping Address",\r\n"var order.getShippingDescription()":"Shipping Description",\r\n"layout handle=\\"sales_email_order_items\\" order=$order":"Order Items Grid",\r\n"var order.getEmailCustomerNote()":"Email Order Note"}'),
(2, 'rentRam footer', '	<tr>\r\n				<td colspan="3">\r\n					<br/>\r\n					Regards,<br/>\r\n					<b>Rentram.com team</b><br/>\r\n					\r\n                                                 {{depend store_phone}}\r\n                                               Helpline Number:\r\n                                                    <a href="tel:{{var phone}}">{{var store_phone}}</a><br>\r\n                                              {{/depend}}\r\n                                               {{depend store_hours}}\r\n                                                  <span class="no-link">{{var store_hours}}</span><br>\r\n                                                 {{/depend}}\r\n                                                {{depend store_email}}\r\n                                                    Email: <a href="mailto:{{var store_email}}">{{var store_email}}</a>\r\n                                              {{/depend}}\r\n                     \r\n				</td>\r\n			</tr>\r\n	</table>\r\n</div>\r\n</body>\r\n</html>', NULL, 1, 'Email - Footer', NULL, NULL, '2016-01-16 01:40:48', '2016-01-23 10:57:32', 'design_email_footer', NULL),
(3, 'Seller email after booking', '<!DOCTYPE html PUBLIC "-//W3C//DTD XHTML 1.0 Strict//EN" "http://www.w3.org/TR/xhtml1/DTD/xhtml1-strict.dtd">\r\n<html xmlns="http://www.w3.org/1999/xhtml">\r\n<head>\r\n    <meta http-equiv="Content-Type" content="text/html; charset=utf-8" />\r\n    <meta name="viewport" content="initial-scale=1.0, width=device-width" />\r\n</head>\r\n<body>\r\n{{var non_inline_styles}}\r\n<div style="align:center;    margin: 20px;">\r\n	<table cellpadding="0" cellspacing="0" border="0" align="center" class="container-table">\r\n			<tr>\r\n				 <td colspan="3">\r\n                     Hello  {{var vendor_name}}\r\n                 </td>\r\n			</tr>\r\n			<tr>\r\n				<td style="width:15%;"></td>\r\n				<td class="logo" style="width:15%;">\r\n					<a href="{{store url=""}}">\r\n                              <img {{if logo_width}}  width="{{var logo_width}}"\r\n                                       {{else}}  width="165"  {{/if}}\r\n                                       {{if logo_height}}  height="{{var logo_height}}"\r\n                                      	{{else}}  height="48"\r\n                                        {{/if}} src="{{var logo_url}}"  alt="{{var logo_alt}}"\r\n                                            border="0"/>\r\n                     </a>\r\n				</td>\r\n{{inlinecss file="email-inline.css"}}\r\n			 	<td style="text-align: left !important;" class="order-details">\r\n	           		 <h3>Your order <span class="no-link">#{{var order.increment_id}}</span></h3>\r\n	           		 <p>Placed on {{var order.getCreatedAtFormated(''long'')}}</p>\r\n	        	</td>\r\n		\r\n			</tr>\r\n			<tr>\r\n				<td colspan="3">\r\n					<p>Congratulations!. Your item "text from product header" has been booked for rent.\r\n                                                    The security amount and initails month;s amount would be trasferred to your account shortly</p>\r\n				</td>\r\n			</tr>\r\n			<tr>\r\n				<td colspan="3">\r\n					Rent Order Summary\r\n				</td>\r\n			</tr>{{htmlescape var=$order.getCustomerName()}}\r\n			<tr>\r\n				<td>\r\n					Seller:<br/>\r\n					Transaction id :<br/>\r\n					Product category : <br/>\r\n					Product description :<br/>\r\n					Monthly Rent :<br/>\r\n					Advance deposit : <br/>\r\n					Subtotal : <br/>	<br/>\r\n					Renram transportation booked : yes/no\r\n				</td>\r\n				<td colspan="2">		\r\n						 Order places on :<br/>\r\n						 Quantity : <br/>\r\n				</td>\r\n			</tr>\r\n			<tr>\r\n				<td colspan="3">\r\n					<p>\r\n						Please get your product ready for Rentram quality check today itself. We will arrange a call to pick up the item.\r\n					</p>\r\n				</td>\r\n				\r\n			</tr>\r\n			<tr>\r\n				<td>\r\n				</td>\r\n				<td colspan="2">\r\n					 Like Rentram.com?Connect with us! \r\n					 <img src="facebook"></img>\r\n					 <img src="twitter"></img>\r\n				</td>\r\n			</tr>\r\n{{template config_path="design/email/footer"}}', 'body,td { color:#2f2f2f; font:11px/1.35em Verdana, Arial, Helvetica, sans-serif; }', 2, 'Your item of "text from product header" is booked for rent at Renram.com', NULL, NULL, '2016-01-22 11:46:32', '2016-01-23 10:42:22', 'marketplace_email_email_template', '{"store url=\\"\\"":"Store Url",\r\n"var logo_url":"Email Logo Image Url",\r\n"var logo_alt":"Email Logo Image Alt",\r\n"var vendor_name":"Vendor Name",\r\n"var customer_name":"Customer Name",\r\n"var order_no":"Order No.",\r\n"var store.getFrontendName()":"Store Name",\r\n"store url=\\"customer/account/\\"":"Customer Account Url",\r\n"var billing_address":"Billing Address",\r\n"var shipping_address":"Shipping Address",\r\n"var sales_email_order_items":"Order Items Grid"}'),
(4, 'Customer after account creation', '<!DOCTYPE html PUBLIC "-//W3C//DTD XHTML 1.0 Strict//EN" "http://www.w3.org/TR/xhtml1/DTD/xhtml1-strict.dtd">\r\n<html xmlns="http://www.w3.org/1999/xhtml">\r\n<head>\r\n    <meta http-equiv="Content-Type" content="text/html; charset=utf-8" />\r\n    <meta name="viewport" content="initial-scale=1.0, width=device-width" />\r\n</head>\r\n<body>\r\n{{var non_inline_styles}}\r\n<div style="align:center;    margin: 20px;">\r\n	<table cellpadding="0" cellspacing="0" border="0">\r\n			<tr>\r\n				 <td colspan="3">\r\n                                          Hello \r\n                              </td>\r\n			</tr>\r\n			<tr>\r\n				 <td colspan="3">\r\n                                         Thank you for creating your account at Rentram.com.\r\n                              </td>\r\n		\r\n			</tr>\r\n			<tr>\r\n				<td colspan="3">\r\n					Your user id is :<br/>\r\n                                         Your password is : \r\n                                      \r\n				</td>\r\n			</tr>\r\n			<tr>\r\n				<td colspan="3">\r\n					<img src=""></img>\r\n				</td>\r\n			</tr>\r\n			<tr>\r\n				<td colspan="3">\r\n					Check out our the products on rent in these categories \r\n                                      \r\n				</td>\r\n			</tr>\r\n			\r\n			<tr>\r\n				<td>\r\n				</td>\r\n				<td colspan="2">\r\n					 Like Rentram.com?Connect with us! \r\n					 <img src="facebook"></img>\r\n					 <img src="twitter"></img>\r\n				</td>\r\n			</tr>\r\n{{template config_path="design/email/footer"}}', NULL, 2, 'Your Rentram.com account is now active ', NULL, NULL, '2016-01-22 11:49:37', '2016-01-23 10:49:51', 'customer_create_account_email_confirmed_template', '{"store url=\\"\\"":"Store Url",\r\n"var logo_url":"Email Logo Image Url",\r\n"var logo_alt":"Email Logo Image Alt",\r\n"htmlescape var=$customer.name":"Customer Name",\r\n"store url=\\"customer/account/\\"":"Customer Account Url"}'),
(5, 'Registry of a seller', '<!DOCTYPE html PUBLIC "-//W3C//DTD XHTML 1.0 Strict//EN" "http://www.w3.org/TR/xhtml1/DTD/xhtml1-strict.dtd">\r\n<html xmlns="http://www.w3.org/1999/xhtml">\r\n<head>\r\n    <meta http-equiv="Content-Type" content="text/html; charset=utf-8" />\r\n    <meta name="viewport" content="initial-scale=1.0, width=device-width" />\r\n</head>\r\n<body>\r\n{{var non_inline_styles}}\r\n<div style="align:center;    margin: 20px;">\r\n	<table cellpadding="0" cellspacing="0" border="0" align="center" class="container-table">\r\n			<tr>\r\n				 <td colspan="3">\r\n                     Hello {{htmlescape var=$order.getCustomerName()}}\r\n                 </td>\r\n			</tr>\r\n			<tr>\r\n				<td style="width:15%;"></td>\r\n				<td class="logo" style="width:15%;">\r\n					<a href="{{store url=""}}">\r\n                              <img {{if logo_width}}  width="{{var logo_width}}"\r\n                                       {{else}}  width="165"  {{/if}}\r\n                                       {{if logo_height}}  height="{{var logo_height}}"\r\n                                      	{{else}}  height="48"\r\n                                        {{/if}} src="{{var logo_url}}"  alt="{{var logo_alt}}"\r\n                                            border="0"/>\r\n                     </a>\r\n				</td>\r\n{{inlinecss file="email-inline.css"}}\r\n			 	<td style="text-align: left !important;" class="order-details">\r\n	           		\r\n	        	</td>\r\n		\r\n			</tr>\r\n			<tr>\r\n				<td colspan="3">\r\n					<p>Congratulations! Your account is now active. You can now start renting on our platform.</p>\r\n				</td>\r\n			</tr>\r\n			<tr>\r\n				<td colspan="3">\r\n					user name : <br/>\r\n                                        password :\r\n				</td>\r\n			</tr>\r\n			\r\n			<tr>\r\n				<td colspan="3">\r\n					<p>\r\n					Have questions? Feel free to reach us as our helpline number or email us \r\n					</p>\r\n				</td>\r\n				\r\n			</tr>\r\n			\r\n{{template config_path="design/email/footer"}}', 'body,td { color:#2f2f2f; font:11px/1.35em Verdana, Arial, Helvetica, sans-serif; }', 2, 'Your Rentram.com account is now active ', NULL, NULL, '2016-01-22 11:50:52', '2016-01-23 10:53:26', 'marketplace_registration_confirmation_email_email_template', '{"store url=\\"\\"":"Store Url",\r\n"var logo_url":"Email Logo Image Url",\r\n"var logo_alt":"Email Logo Image Alt",\r\n"var activate_url":"Activate URL",\r\n"var firstname":"First Name",\r\n"var lastname":"Last Name",\r\n"var store.getFrontendName()":"Store Name",\r\n"store url=\\"adminhtml/index/index/\\"":"Admin Login Url"}'),
(6, 'Monthly rent reminder email', '<!DOCTYPE html PUBLIC "-//W3C//DTD XHTML 1.0 Strict//EN" "http://www.w3.org/TR/xhtml1/DTD/xhtml1-strict.dtd">\r\n<html xmlns="http://www.w3.org/1999/xhtml">\r\n<head>\r\n    <meta http-equiv="Content-Type" content="text/html; charset=utf-8" />\r\n    <meta name="viewport" content="initial-scale=1.0, width=device-width" />\r\n</head>\r\n<body>\r\n{{var non_inline_styles}}\r\n<div style="align:center;    margin: 20px;">\r\n	<table cellpadding="0" cellspacing="0" border="0" align="center" class="container-table">\r\n			<tr>\r\n				 <td colspan="3">\r\n                     Hello \r\n                 </td>\r\n			</tr>\r\n			\r\n			<tr>\r\n				<td colspan="3">\r\n					<p>This is to remind you that the rent for Rs xxx (insert rent here) is due on coming Sunday for the current month. </p>\r\n                                          <p> We will call you to book time for rent collection on Sunday. Alternatively you can also send the rent to us online </p>\r\n				</td>\r\n			</tr>\r\n			<tr>\r\n				<td colspan="3">\r\n					<a href="#">Please login here </a>\r\n				</td>\r\n			</tr>\r\n			\r\n			<tr>\r\n				<td colspan="3">\r\n                                              <p>Please note that late payment may leed to penalty charges </p>\r\n					<p>\r\n						<a href="#">Need to make changes to your order? Visit our Help Page for more information. </a>\r\n					</p>\r\n					\r\n				</td>\r\n				\r\n			</tr>\r\n			<tr>\r\n				<td>\r\n				</td>\r\n				<td colspan="2">\r\n					 Like Rentram.com?Connect with us! \r\n					 <img src="facebook"></img>\r\n					 <img src="twitter"></img>\r\n				</td>\r\n			</tr>\r\n{{template config_path="design/email/footer"}}', NULL, 2, 'Your rent for the month for the item will be due on this Sunday', NULL, NULL, '2016-01-22 11:52:03', '2016-01-23 10:57:09', 'sales_email_order_comment_template', '{"store url=\\"\\"":"Store Url",\r\n"var logo_url":"Email Logo Image Url",\r\n"var logo_alt":"Email Logo Image Alt",\r\n"htmlescape var=$order.getCustomerName()":"Customer Name",\r\n"var order.increment_id":"Order Id",\r\n"var order.getStatusLabel()":"Order Status",\r\n"store url=\\"customer/account/\\"":"Customer Account Url",\r\n"var comment":"Order Comment",\r\n"var store.getFrontendName()":"Store Name"}'),
(7, 'Monthly payment conf''n email', '<!DOCTYPE html PUBLIC "-//W3C//DTD XHTML 1.0 Strict//EN" "http://www.w3.org/TR/xhtml1/DTD/xhtml1-strict.dtd">\r\n<html xmlns="http://www.w3.org/1999/xhtml">\r\n<head>\r\n    <meta http-equiv="Content-Type" content="text/html; charset=utf-8" />\r\n    <meta name="viewport" content="initial-scale=1.0, width=device-width" />\r\n</head>\r\n<body>\r\n{{var non_inline_styles}}\r\n<div style="align:center;    margin: 20px;">\r\n	<table cellpadding="0" cellspacing="0" border="0" align="center" class="container-table">\r\n			<tr>\r\n				 <td colspan="3">\r\n                     Hello \r\n                 </td>\r\n			</tr>\r\n			\r\n			<tr>\r\n				<td colspan="3">\r\n					<p>Thank you for the rent for this month. Your next payment would be due on the first Sunday of the next month.</p>\r\n<p>We hope you like our services.</p>\r\n				</td>\r\n			</tr>		\r\n			\r\n			<tr>\r\n				<td>\r\n				</td>\r\n				<td colspan="2">\r\n					 Like Rentram.com?Connect with us! \r\n					 <img src="facebook"></img>\r\n					 <img src="twitter"></img>\r\n				</td>\r\n			</tr>\r\n{{template config_path="design/email/footer"}}', NULL, 2, 'Your Rent for this month is now received.', NULL, NULL, '2016-01-22 11:53:56', '2016-01-23 10:59:37', 'checkout_payment_failed_template', '{"var reason":"Transaction Failed Reason",\r\n"var checkoutType":"Checkout Type",\r\n"var customerEmail":"Customer Email",\r\n"var customer":"Customer Name",\r\n"var items":"Shopping Cart Items",\r\n"var total":"Total",\r\n"var billingAddress.format(''html'')":"Billing Address",\r\n"var shippingAddress.format(''html'')":"Shipping Address",\r\n"var shippingMethod":"Shipping Method",\r\n"var paymentMethod":"Payment Method",\r\n"var dateAndTime":"Date and Time of Transaction"}'),
(8, 'rentram email header', '<!DOCTYPE html PUBLIC "-//W3C//DTD XHTML 1.0 Strict//EN" "http://www.w3.org/TR/xhtml1/DTD/xhtml1-strict.dtd">\r\n<html xmlns="http://www.w3.org/1999/xhtml">\r\n<head>\r\n    <meta http-equiv="Content-Type" content="text/html; charset=utf-8" />\r\n    <meta name="viewport" content="initial-scale=1.0, width=device-width" />\r\n</head>\r\n<body>\r\n{{var non_inline_styles}}\r\n<div style="align:center;    margin: 20px;">\r\n	<table cellpadding="0" cellspacing="0" border="0" align="center" class="container-table">\r\n			<tr>\r\n				 <td colspan="3">\r\n                     Hello \r\n                 </td>\r\n			</tr>\r\n			<tr>\r\n				<td style="width:15%;"></td>\r\n				<td class="logo" style="width:15%;">\r\n					<a href="{{store url=""}}">\r\n                              <img {{if logo_width}}  width="{{var logo_width}}"\r\n                                       {{else}}  width="165"  {{/if}}\r\n                                       {{if logo_height}}  height="{{var logo_height}}"\r\n                                      	{{else}}  height="48"\r\n                                        {{/if}} src="{{var logo_url}}"  alt="{{var logo_alt}}"\r\n                                            border="0"/>\r\n                     </a>\r\n				</td>', NULL, 1, 'Email - Header', NULL, NULL, '2016-01-22 11:54:32', '2016-01-23 01:03:36', 'design_email_header', NULL);
